import argparse, base64

rc = r'''
1 VERSIONINFO
FILEVERSION @FileVersion
PRODUCTVERSION @FileVersion
FILEOS 0x40004
FILETYPE 0x1
{
BLOCK "StringFileInfo"
{
	BLOCK "040904B0"
	{
		VALUE "FileDescription", "Techmino Alpha"
		VALUE "CompanyName", "26F Studio"
		VALUE "LegalCopyright", "Copyright @ 26F Studio"
		VALUE "ProductName", "Techmino"
		VALUE "ProductVersion", "@Version"
	}
}

BLOCK "VarFileInfo"
{
	VALUE "Translation", 0x0409 0x04E4  
}
}
'''

icon = ''''''

if __name__ == "__main__":
    parser = argparse.ArgumentParser(description="用于更新exe信息的脚本")
    parser.add_argument("-V", "--Version", type=str, help = "游戏版本号")
    args = parser.parse_args()
    Version = args.Version.replace('V', '')
    FileVersion = (f"{Version.replace('.', ',')},0")
    rc = (rc.replace('@Version', Version)).replace('@FileVersion', FileVersion)
    with open("Techmino.rc", "w+", encoding="utf-8") as file:
        file.write(rc)
    with open("icon.ico", "wb+") as file:
        file.write(base64.b64decode(icon))
    print (Version)